//src6, 1ms58ss
import React, { Component } from 'react';

class StudyForm extends Component {
  // 3ms30ss
  state = {
    fullname: '',
    course: 'nodejs',
    object: 'ngKhuyetTat', //1m18ss
    sendMail: false,
  }

  handleChange = (event) => {
    // 2ms25ss
    const { name, value } = event.target;
    console.log(name, value);
    this.setState({ [name]: value });
    // console.log(this.state); // v46xx1

    //3ms56ss, 4ms43ss
    // this.setState({ fullname: event.target.value });
  }

  handleSubmit = (event) => {
    event.preventDefault();
    console.log(this.state); //4ms24ss

    // 3ms56ss, 5ms41ss
    // alert('A name was submitted: ' + this.state.fullname);
  }

  render() {
    const { fullname, course, object, sendMail } = this.state;

    return (
      <div className="row" style={{ margin: '20px 8px' }}>
        <div className="panel panel-info">
          <div className="panel-heading">
            <h3 className="panel-title">Study Form</h3>
          </div>

          <div className="panel-body">
            <form
              action="#" method="post"
              onSubmit={this.handleSubmit} //5ms41ss
            >
              <legend>Form Register</legend>

              <div className="form-group">
                <label htmlFor="">Họ Tên</label>
                <input
                  className="form-control"
                  id="" input='true'
                  placeholder="Fullname"
                  type="text"

                  name='fullname' //2ms25ss

                  // 4ms43ss
                  value={fullname}
                  onChange={this.handleChange}
                />
              </div>

              <div className="form-group">
                <label htmlFor="">Khóa học</label>
                <select
                  className="form-control" required="required"
                  id='input'

                  name='course' //2ms25ss

                  //41ss
                  value={course}
                  onChange={this.handleChange}
                >
                  <option value="angular">Angular</option>
                  <option value="react">React</option>
                  <option value="nodejs">Nodejs</option>
                  <option value="php">Php</option>
                </select>
              </div>

              <div className="form-group">
                <label>Đối tượng</label>
                <div className='radio'>
                  <label>
                    <input
                      type='radio'
                      name='object'
                      value='oldStudent'
                      checked={object === 'oldStudent'} //1m18ss
                      onChange={this.handleChange}
                    /> Học viên cũ
                  </label>
                </div>
                <div className='radio'>
                  <label>
                    <input
                      type='radio'
                      name='object'
                      value='curStudent'
                      checked={object === 'curStudent'} //1m18ss
                      onChange={this.handleChange} //3ms42ss
                    /> Học sinh - sinh viên
                  </label>
                </div>
                <div className='radio'>
                  <label>
                    <input
                      type='radio'
                      name='object'
                      value='ngKhuyetTat'
                      checked={object === 'ngKhuyetTat'} //1m18ss
                      onChange={this.handleChange} //3ms42ss
                    /> Người khuyết tật
                  </label>
                </div>
              </div>

              <div className="checkbox">
                <label htmlFor="sendMail">
                  <input
                    id='sendMail'
                    type="checkbox"
                    name='sendMail'
                    checked={sendMail === false} //1m18ss
                    value='true'
                    onChange={this.handleChange}
                  />
                  Send mail
                </label>
              </div>
              <button type="submit" className="btn btn-primary">Submit</button>
            </form>
          </div>
        </div>
      </div>
    )
  }
};

export default StudyForm;
